const CollectionPreview = ({ title, routeName, items }) => {
  console.log(title);
  console.log(items);
  return (
    <div className="collection-preview">
      <h1 className="title">{title}</h1>
      {}
      <div className="preview">
        {items.map((item) => {
          return <div></div>;
        })}
      </div>
    </div>
  );
};

export default CollectionPreview;
